import React from 'react';
import './LandingPage.css';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <div className="hero-section">
        <div style={{ textAlign: 'center', marginBottom: '40px', marginTop: '-80px' }}>
          <div style={{
            color: 'black', 
            fontSize: '48px', 
            fontFamily: 'Oxygen Mono', 
            fontWeight: 400, 
            wordWrap: 'break-word',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            gap: '12px',
            marginBottom: '16px'
          }}>
            <div style={{width: '40px', height: '40px', position: 'relative', flexShrink: 0, borderRadius: '50%', background: 'linear-gradient(180deg, #EAF3FA 0%, #BFE1FD 100%)', display: 'flex', alignItems: 'center', justifyContent: 'center'}}>
              <div style={{width: '32px', height: '32px', position: 'relative'}}>
                <div style={{width: '17.35px', height: '0px', left: '16.66px', top: '0px', position: 'absolute', transform: 'rotate(163deg)', transformOrigin: 'top left', outline: '0.50px #ECF4FB solid', outlineOffset: '-0.25px'}}></div>
                <div style={{width: '10.16px', height: '0px', left: '16.50px', top: '0.16px', position: 'absolute', transform: 'rotate(50deg)', transformOrigin: 'top left', outline: '0.50px #A2C5F4 solid', outlineOffset: '-0.25px'}}></div>
                <div style={{width: '23.11px', height: '0px', left: '0.07px', top: '5.10px', position: 'absolute', transform: 'rotate(7deg)', transformOrigin: 'top left', outline: '0.50px #A2C5F4 solid', outlineOffset: '-0.25px'}}></div>
                <div style={{width: '19.24px', height: '0px', left: '22.93px', top: '7.86px', position: 'absolute', transform: 'rotate(128deg)', transformOrigin: 'top left', outline: '0.50px #DDE7F4 solid', outlineOffset: '-0.25px'}}></div>
                <div style={{width: '21px', height: '0px', left: '0px', top: '5.15px', position: 'absolute', transform: 'rotate(58deg)', transformOrigin: 'top left', outline: '0.50px #BCD4F3 solid', outlineOffset: '-0.25px'}}></div>
              </div>
            </div>
            eigenverse 
          </div>
          <div style={{
            color: 'black', 
            fontSize: '16px', 
            fontFamily: 'Play', 
            fontWeight: 400, 
            wordWrap: 'break-word'
          }}>
            Turning scary equations into aha moments.
          </div>
        </div>

        <div style={{
          display: 'flex',
          gap: '40px',
          marginBottom: '80px'
        }}>
          <button 
            onMouseEnter={(e) => {
              e.target.style.border = '2px solid rgba(255, 255, 255, 0.8)';
              e.target.style.transform = 'scale(1.05)';
            }}
            onMouseLeave={(e) => {
              e.target.style.border = 'none';
              e.target.style.transform = 'scale(1)';
            }}
            style={{
              width: '110px',
              height: '60px',
              background: 'linear-gradient(90deg, #D1E4FD 0%, #D7E6F9 29%)',
              border: 'none',
              color: 'black',
              fontSize: '20px',
              fontFamily: 'Oxygen Mono',
              fontWeight: 400,
              cursor: 'pointer',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              transition: 'all 0.2s ease'
            }}>
            learn
          </button>
          <button 
            onMouseEnter={(e) => {
              e.target.style.border = '2px solid rgba(255, 255, 255, 0.8)';
              e.target.style.transform = 'scale(1.05)';
            }}
            onMouseLeave={(e) => {
              e.target.style.border = 'none';
              e.target.style.transform = 'scale(1)';
            }}
            style={{
              width: '110px',
              height: '60px',
              background: 'linear-gradient(90deg, #D1E4FD 0%, #D7E6F9 29%)',
              border: 'none',
              color: 'black',
              fontSize: '20px',
              fontFamily: 'Oxygen Mono',
              fontWeight: 400,
              cursor: 'pointer',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              transition: 'all 0.2s ease'
            }}>
            log in
          </button>
        </div>

        <div style={{
          color: 'black',
          fontSize: '12px',
          fontFamily: 'Oxygen Mono',
          fontWeight: 400,
          textAlign: 'center',
          maxWidth: '600px'
        }}>
          Most ML tutorials skip the math. Most math texts skip the ML. We connect the two.
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
